import React, {Component} from 'react';
import "./Classic.css"
import StyleReader from "../../../../utils/StyleReader";
import {connect} from "react-redux";

class Classic extends Component {
    render() {
        const componentStyles = this.props.componentStyles;

        const text = componentStyles.text || "Scooby Doo";
        const styleReader = new StyleReader(componentStyles);

        return (
            <button className={this.props.className + " classic-btn"}
                    style={styleReader.style}
                    onClick={ e => this.handleClick(e) }>
                {text}
            </button>
        )
    }

    handleClick(e) {
        e.preventDefault();
    }
}

const mapStateToProps = (state) => {
    const isUserComponent = state.currentComponent.isUserComponent;
    const userComponentName = state.currentComponent.userComponentName;
    const componentStyles = isUserComponent ? state.userLibrary[userComponentName] : state.libraryState.Classic;
    console.log("button")
    return {
        componentStyles,
    }

}

export default connect(mapStateToProps)(Classic);
